import React from "react";
import { connect } from "react-redux";
import "./App.css";
import Job from "./Job/Job";
import {
  selectInitializedSelector,
  thunkSetInitialized,
} from "./redux/initSlice";
import { AppDispatch, RootState } from "./redux/store";

function App(props: { initialized: boolean; onSetIinitialized: any }) {
  const { initialized, onSetIinitialized } = props;
  if (!initialized) {
    onSetIinitialized(initialized);
  }
  return (
    <div className="App">
      <Job />
    </div>
  );
}
const mapStatetoProps = (state: RootState) => ({
  initialized: selectInitializedSelector(state),
});

const mapDispatchToProps = (dispatch: AppDispatch) => ({
  onSetInitialized: (flag: boolean) => {
    dispatch(thunkSetInitialized(flag));
  },
});

export default connect(mapStatetoProps, mapDispatchToProps)(App);
